"use strict";(self.webpackChunkdocs=self.webpackChunkdocs||[]).push([[8777],{6671:e=>{e.exports=JSON.parse('{"version":{"pluginId":"default","version":"current","label":"Next","banner":null,"badge":false,"noIndex":false,"className":"docs-version-current","isLast":true,"docsSidebars":{"tutorialSidebar":[{"type":"link","label":"Wiki Unit Electronics","href":"/wiki_docsaurus/docs/intro","docId":"intro","unlisted":false},{"type":"category","label":"UNIT - Development boards","collapsible":true,"collapsed":true,"items":[{"type":"link","label":"DualMCU","href":"/wiki_docsaurus/docs/Development_boards/DualMCU","docId":"Development_boards/DualMCU","unlisted":false},{"type":"link","label":"DualMCU ONE","href":"/wiki_docsaurus/docs/Development_boards/DualMCU_ONE","docId":"Development_boards/DualMCU_ONE","unlisted":false},{"type":"link","label":"Cocket Nova","href":"/wiki_docsaurus/docs/Development_boards/cocket_nova","docId":"Development_boards/cocket_nova","unlisted":false},{"type":"link","label":"Nano C6","href":"/wiki_docsaurus/docs/Development_boards/nano_c6","docId":"Development_boards/nano_c6","unlisted":false}],"href":"/wiki_docsaurus/docs/category/unit---development-boards"},{"type":"category","label":"UNIT - Modules","collapsible":true,"collapsed":true,"items":[{"type":"link","label":"Haptic Motor Driver Module","href":"/wiki_docsaurus/docs/Modules/haptic_motor_driver","docId":"Modules/haptic_motor_driver","unlisted":false},{"type":"link","label":"LiPo Charger Boost & I2C Monitor","href":"/wiki_docsaurus/docs/Modules/lipo_module","docId":"Modules/lipo_module","unlisted":false},{"type":"link","label":"Lumiknob Module","href":"/wiki_docsaurus/docs/Modules/lumiknob","docId":"Modules/lumiknob","unlisted":false}],"href":"/wiki_docsaurus/docs/category/unit---modules"},{"type":"category","label":"UNIT - Accessories","collapsible":true,"collapsed":true,"items":[{"type":"link","label":"PAM8403 Audio Amplifier 3W","href":"/wiki_docsaurus/docs/Accessories/ampli","docId":"Accessories/ampli","unlisted":false}],"href":"/wiki_docsaurus/docs/category/unit---accessories"},{"type":"category","label":"UNIT - Firmware","collapsible":true,"collapsed":true,"items":[{"type":"link","label":"Nova Firmware programmer","href":"/wiki_docsaurus/docs/Firmware/nova_programmer","docId":"Firmware/nova_programmer","unlisted":false},{"type":"link","label":"Firmware Documentation","href":"/wiki_docsaurus/docs/Firmware/coketo","docId":"Firmware/coketo","unlisted":false}],"href":"/wiki_docsaurus/docs/category/unit---firmware"},{"type":"link","label":"FAQ","href":"/wiki_docsaurus/docs/FAQ","docId":"FAQ","unlisted":false},{"type":"link","label":"custom","href":"/wiki_docsaurus/docs/custom","docId":"custom","unlisted":false}]},"docs":{"Accessories/ampli":{"id":"Accessories/ampli","title":"PAM8403 Audio Amplifier 3W","description":"The UNIT PAM8403 Audio Amplifier 3W is a Class D audio amplification module designed to deliver up to 3W per channel of stereo output with high efficiency. It is ideal for portable audio applications and projects with low-power devices, such as music players, portable speakers, and battery-powered systems.","sidebar":"tutorialSidebar"},"custom":{"id":"custom","title":"custom","description":"","sidebar":"tutorialSidebar"},"Development_boards/cocket_nova":{"id":"Development_boards/cocket_nova","title":"Cocket Nova","description":"Explore the amazing features of the Cocket Nova development board, which runs on the CH552G microcontroller. This handy board makes it easy to kickstart your embedded projects.","sidebar":"tutorialSidebar"},"Development_boards/DualMCU":{"id":"Development_boards/DualMCU","title":"DualMCU","description":"Unit DualMCU brings the Raspberry Pi RP2040 microcontroller plus an Espressif ESP32 WROOM chip in a simple one module, make the most of the dual core 32-bit Arm\xae Cortex\xae-M0+ to make Internet of Things projects with Bluetooth\xae and Wi-Fi connectivity.","sidebar":"tutorialSidebar"},"Development_boards/DualMCU_ONE":{"id":"Development_boards/DualMCU_ONE","title":"DualMCU ONE","description":"The UNIT DualMCU-ONE is a highly versatile development board that integrates the power of two microcontrollers: the ESP32 and the RP2040. Designed for advanced IoT, robotics, and industrial applications, it provides enhanced connectivity, robust power management, and full compatibility with Arduino UNO shields.","sidebar":"tutorialSidebar"},"Development_boards/nano_c6":{"id":"Development_boards/nano_c6","title":"Nano C6","description":"We are currently working on the design of this new development board, UNIT NANO C6, at UNIT Electronics. Stay tuned for upcoming updates, including the schematic and future iterations. Our goal is to provide comprehensive resources that support the use and development with the UNIT NANO C6.","sidebar":"tutorialSidebar"},"FAQ":{"id":"FAQ","title":"FAQ","description":"","sidebar":"tutorialSidebar"},"Firmware/coketo":{"id":"Firmware/coketo","title":"Firmware Documentation","description":"Welcome to the firmware documentation for the Coketo project. This section provides detailed information about the firmware used in our devices.","sidebar":"tutorialSidebar"},"Firmware/nova_programmer":{"id":"Firmware/nova_programmer","title":"Nova Firmware programmer","description":"The Nova Programmer is a versatile firmware that allows you to program various microcontrollers and FPGA  using the CH55x series. This firmware is compatible with the Cocket Nova development board and other CH55x-based boards. The Nova Programmer firmware is designed to simplify the programming process by providing a user-friendly interface and supporting multiple programming modes.","sidebar":"tutorialSidebar"},"intro":{"id":"intro","title":"Wiki Unit Electronics","description":"Introduction","sidebar":"tutorialSidebar"},"Modules/haptic_motor_driver":{"id":"Modules/haptic_motor_driver","title":"Haptic Motor Driver Module","description":"Haptic Motor Driver Module is a module that can be used to drive a haptic motor. The module is based on the DRV2605L haptic motor driver IC. The DRV2605L is a versatile haptic driver that can be used to drive a linear resonant actuator (LRA) or an eccentric rotating mass (ERM) motor, providing a wide range of haptic effects. The module is designed to be used with compatible STEMMA QT connectors and qwiic connectors.","sidebar":"tutorialSidebar"},"Modules/lipo_module":{"id":"Modules/lipo_module","title":"LiPo Charger Boost & I2C Monitor","description":"The UNIT LiPo Charger Boost & I2C Monitor is an advanced charging and monitoring module for single-cell LiPo batteries (3.7V to 4.2V). It integrates a TP4056 charger, an MT3608 voltage booster with output limited to 27V, and a MAX17048 battery monitor over I2C. This module is ideal for applications requiring efficient charging and real-time battery monitoring.","sidebar":"tutorialSidebar"},"Modules/lumiknob":{"id":"Modules/lumiknob","title":"Lumiknob Module","description":"The Module Potentiometer Interface SPI MAX7219 32 LED Sequential is a module that allows you to control 32 LEDs sequentially using a potentiometer. The module uses the SPI protocol to communicate with the MAX7219 LED driver, which controls the LEDs. The potentiometer is used to adjust the speed at which the LEDs are lit up.","sidebar":"tutorialSidebar"}}}}')}}]);